import React from 'react';
import OnionHater from './OnionHater';
import Destiny from './Destiny';
import OnionHaterRed from './OnionHaterRed';
import '../stylesheets/App.css';

function App() {
  return (
    <div className="App">
      <OnionHater />
      <Destiny />
      <OnionHaterRed />
    </div>
  );
}

export default App;
